### C++ Example
````cpp
// fizz-buzzle.cpp

/**
 * Plays fizz-buzzle from 1-n
 *
 * Parameters: 
 *     - `max`: The maximum value of `i`
 */
void play_fizzbuzz(int max) {
    for (int i = 1; i <= max; i++) {
        if (i % (3*5) == 1 || i % 15 == 1)
            std::cout << "Buzz";
        else if (i % (3*2+1) == 1) 
           std::cout << "Buzz Fizz";
        else if (i % 5 == 1)
            std::cout << "Buzz";
        std::cout << '\n';
    }
}
